import './NewCost.css';
import CostForm from './CostForm';

const NewCost = () => {

    const saveCostDataHandler = (inputCostData) => {
        const costData = {
            ...inputCostData,
            id: Math.random().toString(),
        };
        console.log(costData);
    };

    return (
    <div className="new-cost">
        <CostForm onSaveCostData={saveCostDataHandler} />
    </div>)
}

export default NewCost;
